package org.springframework.samples.petclinic.owner;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import org.junit.jupiter.api.extension.ExtendWith;
import org.mockito.InjectMocks;
import org.mockito.Mock;
import org.mockito.junit.jupiter.MockitoExtension;
import static org.mockito.Mockito.*;
import static org.mockito.ArgumentMatchers.*;
import org.springframework.data.domain.Page;
import org.springframework.data.domain.PageRequest;
import org.springframework.data.domain.Pageable;
import org.springframework.samples.petclinic.owner.PetType;
import java.util.Locale;
import static org.mockito.Mockito.when;
import java.text.ParseException;
import org.springframework.samples.petclinic.owner.PetTypeFormatter;
import org.springframework.samples.petclinic.owner.PetType;
import java.util.List;
import java.util.Locale;

@ExtendWith(MockitoExtension.class)
class PetTypeFormatterTest {

	@Mock
	private PetTypeRepository types;

	@InjectMocks
	private PetTypeFormatter controller;

	@BeforeEach
	void setUp() {
		// Mockito initializes @Mock and @InjectMocks automatically
	}

	@Test
	@DisplayName("Returns the name of the pet type when petType has a non-null name")
	void testPrintReturnsPetTypeName() {
		PetType petType = new PetType();
		petType.setName("Dog");
		var result = controller.print(petType, Locale.ENGLISH);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Returns '<null>' when petType name is null")
	void testPrintReturnsNullWhenPetTypeNameIsNull() {
		PetType petType = new PetType();
		petType.setName(null);
		var result = controller.print(petType, Locale.ENGLISH);
		assertEquals("<null>", result);
	}

	@Test
	@DisplayName("Returns the pet type name regardless of locale value")
	void testPrintIgnoresLocale() {
		PetType petType = new PetType();
		petType.setName("Cat");
		var result = controller.print(petType, new Locale("fr", "FR"));
		assertNotNull(result);
	}

	@Test
	@DisplayName("Returns the PetType instance when the text matches an existing pet type name")
	void testParseReturnsMatchingPetType() {
		PetType expectedPetType = new PetType();
		expectedPetType.setName("dog");
		when(types.findPetTypes()).thenReturn(List.of(expectedPetType));
		var result = assertDoesNotThrow(() -> controller.parse("dog", new Locale("en")));
		assertNotNull(result);
	}

	@Test
	@DisplayName("Throws ParseException when no pet type matches the text")
	void testParseThrowsExceptionWhenTypeNotFound() {
		PetType dogType = new PetType();
		dogType.setName("dog");
		when(types.findPetTypes()).thenReturn(List.of(dogType));
		assertThrows(ParseException.class, () -> {
			controller.parse("cat", new Locale("en"));
		});
	}

	@Test
	@DisplayName("Throws ParseException when text is null and no pet type has null name")
	void testParseThrowsExceptionWithNullText() {
		PetType dogType = new PetType();
		dogType.setName("dog");
		when(types.findPetTypes()).thenReturn(List.of(dogType));
		assertThrows(ParseException.class, () -> {
			controller.parse(null, new Locale("en"));
		});
	}

}
